class UserInput extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				sometimes in our program we want to get information from the user, such as their name. by the end of this section, you will be able to get <b>user input from the console</b>, which will allow you to create super cool programs that can actually interact with the user!
				<br/><br/>
				there are two things we need to do before we can actually start getting input from the user:
				<ol>
					<li></li>
					<li></li>
				</ol>
			</div>
		)
	}
}

export default UserInput;
